import React from "react"
import ProjectCard from './ProjectCard.js'
import './App.css';
import logo from './images/art.png'

const projects = [
    {link:"/proj1", image:logo, title:"rem", category:"film"}
]

function Project(props) {
  return (
    <div>
      <h1>Project</h1>
      <ProjectCard
        link="/proj1"
        image={logo}
        title="rem"
        category="Film"
      />
    </div>
  )
}


export default Project;
